window.bookSummaryJSON = "<p><i>Hyperion</i></p> <p>By John Keats</p> <p>Narrated by Denis Daly</p> <p>Keats commenced writing his epic poem, <i>Hyperion</i>, in 1818 and ceased working on it in the spring of 1819. He said that he gave the project up for having \"too many Miltonic inversions.\" The unfinished poem, which ceases in the middle of the third canto, was published in 1820.</p> <p>The narrative is based on the <i>Titanomachia</i>, or War of the Titans, and describes the aftermath of their fall to the Olympian Gods.</p>"; 
